import React from 'react';
import './App.css';

function App() {
  const handleClick = () => {
    // Replace this URL with your Google Form URL
    window.location.href = "https://forms.gle/YOUR-FORM-URL";
  };

  return (
    <div className="container">
      <h1>Join Our Waitlist</h1>
      <button onClick={handleClick}>Join Now</button>
    </div>
  );
}

export default App;
